import React, { useEffect, useState } from 'react';

const BookNow = () => {
    const [data, setData] = useState([]);
    const [isFormUpdating, setIsFormUpdating] = useState(false);
    const [Bookings, setBookings] = useState({
        id: "",
        name: "",
        email: "",
        destination: "",
        date: ""
    });

    // Get All Bookings
    useEffect(() => { 
        getAllData();
    }, []);

    const getAllData = async () => {
        await fetch("http://localhost:8000/bookings")
            .then((res) => res.json())
            .then((res) => setData(res));
    }

    // Add Bookings
    const addBookings = async (e) => {
        e.preventDefault();
        try {
            const res = await fetch("http://localhost:8000/bookings", {
                method: "POST",
                body: JSON.stringify(Bookings),
                headers: {
                    "Content-Type": "application/json"
                }
            });
            if (res.ok) {
                alert("Booking Added Successfully!");
                getAllData(); // Fetch data again to update the list after adding
            } else {
                console.error("Error:", res.statusText);
            }
        } catch (err) {
            console.error("Error On Booking:", err);
        }
    };

    const handleChange = (e) => {
        setBookings({
            ...Bookings,
            [e.target.name]: e.target.value // Ensure the input names are consistent
        });
    };

    // Delete Bookings
    const deleteBookings = async (id) => {
        try {
            await fetch(`http://localhost:8000/bookings/${id}`, {
                method: "DELETE"
            });
            getAllData(); // Fetch data again after deletion
        } catch (err) {
            console.error("Error Deleting Booking:", err);
        }
    };

    // Update Bookings
    const updateBookings = async () => {
        try {
            const res = await fetch(`http://localhost:8000/bookings/${Bookings.id}`, {
                method: "PUT",
                body: JSON.stringify(Bookings),
                headers: {
                    "Content-Type": "application/json"
                }
            });
            if (res.ok) {
                alert("Booking Updated successfully!");
                setIsFormUpdating(false); // Reset form state
                setBookings({
                    id: "",
                    name: "",
                    email: "",
                    destination: "",
                    date: ""
                }); // Clear form
                getAllData(); // Fetch data again to update the list after updating
            } else {
                console.error("Error:", res.statusText);
            }
        } catch (err) {
            console.error("Error On Updating booking:", err);
        }
    };

    return (
        <>
            {/* Your existing JSX code */}
            <div className="container">
                <h1 className="text-center text-dark"><b>Book Your Destination</b></h1>
                <form className="mt-4" onSubmit={addBookings}>
                    <div className="mb-3">
                        <label className="form-label">Booking ID</label>
                        <input
                            type="number"
                            className="form-control"
                            name="id"
                            placeholder='Enter Booking ID'
                            value={Bookings.id}
                            onChange={handleChange}
                            required
                            disabled={isFormUpdating} // Disable ID field during update
                        />
                    </div>
                    {/* Rest of the form */}
                    <button type="submit" className="btn btn-outline-secondary text-light"
                        style={{ marginTop: "20px", marginLeft: "600px", width: "200px", fontSize: "20px" }}>
                        Submit
                    </button>
                </form>

                <h2 className='text-center mt-5 text-light fs-1'><b>Bookings That Are Already Done!</b></h2>

                <table className="table mt-4 border-4 border-dark bg-success">
                    <thead className='text-center'>
                        <tr>
                            <th>ID</th>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Destination</th>
                            <th>Date</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            data.map((booking) => (
                                <tr className='mt-3 rounded-4 text-center' key={booking.id}>
                                    <td>{booking.id}</td>
                                    <td>{booking.name}</td>
                                    <td>{booking.email}</td>
                                    <td>{booking.destination}</td>
                                    <td>{booking.date}</td>
                                    <td>
                                        <button className='btn btn-outline-warning text-dark-emphasis' onClick={() => {
                                            setIsFormUpdating(true);
                                            setBookings(booking); // Set selected booking to form
                                        }}>Update</button>
                                        <button className='btn btn-outline-danger ms-3 text-dark-emphasis' onClick={() => deleteBookings(booking.id)}>Delete</button>
                                    </td>
                                </tr>
                            ))
                        }
                    </tbody>
                </table>
            </div>
        </>
    );
}

export default BookNow;
